import React, { useContext, useEffect } from 'react';
import { headerContext } from '../../context/HeaderContext';
import "./Header.css"
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import { Link } from 'react-router-dom';
import Hidden from "@material-ui/core/Hidden";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import SwipeableDrawer from "@material-ui/core/SwipeableDrawer";
import Divider from "@material-ui/core/Divider";
import ChevronRightIcon from "@material-ui/icons/ChevronRight";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";

const Header = () => {
    const { getHeader, header } = useContext(headerContext)
    const [open, setOpen] = useState(false);
    useEffect(() => {
        getHeader()
    }, [])
    return (
        <div>
            {header.map((item) => (
                <div key={item.id}>
                    <div className='header-lines'>
                        <div className='container'>
                            <Hidden xsDown>
                            <div className='header-top'>
                                <div className='header-top-left'>
                                    <Link style={{textDecoration: 'none'}} to={'/about'}>
                                        <span>О нас</span>
                                    </Link>
                                    <span>Коллекции</span>
                                    <Link style={{textDecoration: 'none'}} to={'/news'}>
                                       <span>Новости</span>
                                    </Link>
                                </div>
                                <div className='header-top-right'>
                                    <p><span>Тел:</span><a style={{ textDecoration: "none" }} href={item.number}>{item.number}</a></p>
                                </div>
                                </div>
                            </Hidden>
                        </div>
                    </div>
                    <div className='header-lines'>
                        <div className='container'>
                            <div className='header-bottom'>
                                <div>
                                    <img src={item.logo} alt="the logo" />
                                </div>

                        <div className='search'>
                            <div className='input-icon'>
                                <span className='icon'>
                                    <SearchOutlinedIcon />
                                </span>
                                <input className='input-field' placeholder='Поиск' type="text" />
                            </div>
                                </div>
                            <Hidden xsDown>
                                <div className='header-extra-info'>
                                    <div>
                                        <img width="100%" src={require('../../images/heart-icon.png')} alt="the heart" />
                                    </div>
                                    <div>
                                        <span className='header-selected'>Избранное</span>
                                    </div>
                                    <div>
                                        <img width="100%" src={require('../../images/heart-icon.png')} alt="the heart" />
                                    </div>
                                    <div>
                                        <span className='header-cart'>Корзина</span>
                                    </div>
                                </div>
                            </Hidden>
                            <Hidden smUp>
                                <IconButton onClick={() => setOpen(true)}>
                                <MenuIcon />
                                </IconButton>
                            </Hidden>
                        </div>
                        </div>
                    </div>
                    <SwipeableDrawer
                        anchor="left"
                        open={open}
                        onOpen={() => setOpen(true)}
                        onClose={() => setOpen(false)}
                    >
                        <div
                        onClick={() => setOpen(false)}
                        onKeyPress={() => setOpen(false)}
                        role="button"
                        tabIndex={0}
                        >
                        <IconButton>
                            <ChevronRightIcon />
                        </IconButton>
                        </div>
                        <Divider />
                        <List>
                        {navigationLinks.map((item) => (
                            <ListItem key={item.name}>
                            <Link
                                className={styles.link}
                                color="textPrimary"
                                variant="button"
                                underline="none"
                                href={item.href}
                            >
                                {item.name}
                            </Link>
                            </ListItem>
                        ))}
                        </List>
                </SwipeableDrawer>
                </div>

            ))}
            </div>
    );
};

export default Header;
